/***** Systemak Calendar Aggregator + Icons
 * يجمع events من جداول: AllCalls, AllMeetings, AllTasks
 * ويضيف أيقونات حسب النوع والحالة ويُرجع مصفوفة صالحة للـCalendar.
 ************************************************************/

// ===== 1) إعدادات حسب جداولك =====
const CONFIG = {
  sources: {
    AllCalls:    'AllCalls',     // اسم الـcollection في WeWeb (أو ID)
    AllMeetings: 'AllMeetings',
    AllTasks:    'AllTasks'
  },
  fields: {
    // الحقول حسب السكرينشوت: id, name, notes, date, user_id, status...
    AllCalls: {
      id:       'id',
      title:    'name',
      note:     'notes',
      date:     'date',     // Date فقط
      user_id:  'user_id',
      status:   'status',
      url:      null
    },
    AllMeetings: {
      id:       'id',
      title:    'name',
      note:     'notes',
      date:     'date',     // Date فقط
      user_id:  'user_id',
      status:   'status',
      url:      null
    },
    AllTasks: {
      id:       'id',
      title:    'name',
      note:     'notes',
      date:     'date',     // Date فقط
      user_id:  'user_id',
      status:   'status',   // FK إلى task_status
      url:      null
    }
  },
  colors: {
    AllCalls:    '#1f8ef1',
    AllMeetings: '#22c55e',
    AllTasks:    '#f59e0b'
  },
  // فلتر اختياري قبل الدمج (مثلاً قصر العرض على مستخدم معيّن)
  filters: {
    AllCalls:    (row) => true,
    AllMeetings: (row) => true,
    AllTasks:    (row) => true
  },
  // أيقونات النوع
  typeIcons: {
    AllCalls:    '📞',
    AllMeetings: '📅',
    AllTasks:    '✅'
  },
  // أيقونات الحالة (اختياري — عدّل القيم كما تحب)
  statusIcons: {
    done:       '✔️',
    completed:  '✔️',
    finished:   '✔️',
    cancelled:  '❌',
    canceled:   '❌',
    pending:    '⏳',
    waiting:    '⏳',
    inprogress: '🔄',
    'in-progress': '🔄',
    scheduled:  '🗓️'
  },
  // فعل هذا لو عايز تضيف الأيقونات داخل نص العنوان
  injectIconsIntoTitle: true
};

// ===== 2) أدوات مساعدة =====

// جلب بيانات الـcollection بأمان (يدعم الاسم أو الـID)
function getCollection(key) {
  return (collections?.[key]?.data) ||
         (collections?.[key])?.data ||
         (collections?.[String(key)]?.data) ||
         [];
}

// تحويل قيمة Date (بدون وقت) إلى ISO يبدأ 00:00 مع allDay = true
function dateOnlyToISO(d) {
  if (!d) return undefined;
  try {
    const base = new Date(d);
    if (Number.isNaN(base.getTime())) return undefined;
    base.setHours(0, 0, 0, 0);
    return base.toISOString();
  } catch { return undefined; }
}

// إنشاء نهاية نفس اليوم (حتى لا يشتكي بعض الـCalendars)
function endOfSameDayISO(startISO) {
  if (!startISO) return undefined;
  try {
    const d = new Date(startISO);
    d.setHours(23, 59, 59, 999);
    return d.toISOString();
  } catch { return undefined; }
}

// اختيار أيقونة الحالة (نطبّع النص أولًا)
function pickStatusIcon(statusVal) {
  if (!statusVal) return '';
  const key = String(statusVal).toLowerCase().replace(/\s+/g, '').trim();
  return CONFIG.statusIcons[key] || '';
}

// بناء عنوان مع الأيقونة
function withIcons({ type, status, title }) {
  const typeIcon = CONFIG.typeIcons[type] || '📌';
  const statusIcon = pickStatusIcon(status);
  const t = String(title || '').trim();
  // لو مفعّل حقن الأيقونات داخل العنوان
  if (CONFIG.injectIconsIntoTitle) {
    // مثال: "📅 ✅ اجتماع مع العميل"
    return `${typeIcon}${statusIcon ? ' ' + statusIcon : ''} ${t}`.trim();
  }
  // غير مفعّل: رجّع العنوان بدون تعديل
  return t;
}

// تحويل صفوف جدول إلى Events موحّدة
function rowsToEvents(rows, type, map) {
  const color = CONFIG.colors[type] || '#6b7280';
  return (rows || [])
    .filter(CONFIG.filters[type] || (() => true))
    .map((row) => {
      const id     = row?.[map.id] ?? `${type}-${Math.random().toString(16).slice(2)}`;
      const title  = String(row?.[map.title] ?? `[${type}] بدون عنوان`).trim();
      const note   = row?.[map.note] ?? '';
      const date   = row?.[map.date];
      const status = row?.[map.status] ?? null;

      const startISO = dateOnlyToISO(date);
      const endISO   = endOfSameDayISO(startISO);

      // ابني عنوان مع الأيقونات
      const displayTitle = withIcons({ type, status, title });

      return {
        // الحقول القياسية للـCalendar
        id,
        title: displayTitle,
        start: startISO,
        end: endISO,
        allDay: true,

        // ألوان أساسية (لو الويدجت يستخدمها)
        backgroundColor: color,
        borderColor: color,
        textColor: '#ffffff',

        // بيانات إضافية مفيدة للـrenderers المخصصة
        originalTitle: title,          // العنوان بدون أيقونات
        icon: CONFIG.typeIcons[type] || '📌',
        statusIcon: pickStatusIcon(status),
        description: note,
        status,
        user_id: row?.[map.user_id] ?? null,
        type,                          // AllCalls | AllMeetings | AllTasks
        url: row?.[map.url] || null,
        raw: row
      };
    })
    .filter(ev => ev.start);          // استبعاد من دون تاريخ
}

// ===== 3) التنفيذ =====
const AllCallsRows    = getCollection(CONFIG.sources.AllCalls);
const AllMeetingsRows = getCollection(CONFIG.sources.AllMeetings);
const AllTasksRows    = getCollection(CONFIG.sources.AllTasks);

const callEvents    = rowsToEvents(AllCallsRows,    'AllCalls',    CONFIG.fields.AllCalls);
const meetingEvents = rowsToEvents(AllMeetingsRows, 'AllMeetings', CONFIG.fields.AllMeetings);
const taskEvents    = rowsToEvents(AllTasksRows,    'AllTasks',    CONFIG.fields.AllTasks);

const events = [...callEvents, ...meetingEvents, ...taskEvents]
  .sort((a, b) => new Date(a.start) - new Date(b.start));

// لو عايز تخزنها في متغيّر صفحة (اختياري):
// await utils.setVariable?.('calendar_events', events);
// await variables.set?.('calendar_events', events);

// الـAction output:
return events;
